input1 = ""
input2 = ""
input3 = ""
input4 = ""
input5 = ""

noD = [-19,-5,9,19,29]
noU = [-19,-9,1,15,29]
noL = [1,-9,-19,-5,9]
noR = [1,15,29,19,9]
dontMove = false
length = input5.length
currentNumber = 5
length.times do |a|
	direction = input5[a].to_s
	if direction == "R"
		noR.each do |b|
			if b == currentNumber
				dontMove = true
			end
		end
		if dontMove == false 
			currentNumber += 12
		end
		dontMove = false
	elsif direction == "L"
		noL.each do |b|
			if b == currentNumber
				dontMove = true
			end
		end
		if dontMove == false 
			currentNumber -= 12
		end
		dontMove = false
	elsif direction == "U"
		noU.each do |b|
			if b == currentNumber
				dontMove = true
			end
		end
		if dontMove == false 
			currentNumber -= 2
		end
		dontMove = false
	elsif direction == "D"
		noD.each do |b|
			if b == currentNumber
				dontMove = true
			end
		end
		if dontMove == false 
			currentNumber += 2
		end
		dontMove = false
	end
	puts currentNumber
end

puts currentNumber